import {
  LegendContainer,
  LegendItem,
  LegendImage,
  LegendTitle,
} from "./legend_wind_style";
import ais_legend from "../imgs/ais_legend.png";

function WindLegend() {
  return (
    <LegendContainer>
      <LegendTitle>Ship Type</LegendTitle>
      <LegendImage src={ais_legend} alt="Ship Type" />
    </LegendContainer>
  );
}

export default WindLegend;
